import React from 'react';
import { Link } from '@reach/router';

const Nav = () => {
	return (
		<nav id="sort_by">
			<Link id="sort_by" to="/">
				All.
			</Link>
			<br />
			<Link id="sort_by" to="topic/football">
				Football.
			</Link>
			<br />
			<Link id="sort_by" to="topic/cooking">
				Cooking.
			</Link>
			<br />
			<Link id="sort_by" to="topic/coding">
				Coding.
			</Link>
		</nav>
	);
};
export default Nav;
